@iqthon.on(admin_cmd(pattern="┘Ж╪╡ ╪л╪▒┘К ╪п┘К(?:\s|$)([\s\S]*)"))    
async def figlet(event):
    input_str = event.pattern_match.group(1)
    if ";" in input_str:
        cmd, text = input_str.split(";", maxsplit=1)
    elif input_str is not None:
        cmd = None
        text = input_str
    else:
        await edit_or_reply(event, "**тМФя╕Щ┘В┘Е ╪и╪е╪╣╪╖┘А╪з╪б ┘Ж┘А╪╡ ┘Д╪к╪║┘К┘К┘А╪▒┘З тРе**")
        return
    style = cmd
    text = text.strip()
    if style is not None:
        try:
            font = CMD_FIG[style.strip()]
        except KeyError:
            return await edit_delete(
                event, "**тМФя╕Щ╪к┘Е ╪к╪н╪п┘К┘А╪п ┘Ж┘Е┘А╪╖ ╪║┘К┘А╪▒ ╪╡╪з┘Д┘А╪н тЪая╕П**"
            )
        result = pyfiglet.figlet_format(deEmojify(text), font=font)
