@iqthon.on(admin_cmd(pattern="┘Е┘Д╪╡┘В ┘Е╪к╪н╪▒┘Г(?: |$)(.*)"))
async def honkasays(event):
    await event.edit("**╪м╪з╪▒┘К ╪з┘Д╪к╪н┘И┘К┘Д **")
    text = event.pattern_match.group(1)
    if not text:
        return await event.edit("**┘В┘Е ╪и┘Г╪к╪з╪и┘З ╪з┘Д┘Г┘Д┘Е┘З ╪и╪м╪з┘Ж╪и ╪з┘Д╪з┘Е╪▒**")
    try:
        if not text.endswith("."):
            text = text + "."
        if len(text) <= 9:
            results = await bot.inline_query("honka_says_bot", text)
            await results[2].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        elif len(text) >= 14:
            results = await bot.inline_query("honka_says_bot", text)
            await results[0].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        else:
            results = await bot.inline_query("honka_says_bot", text)
            await results[1].click(
                event.chat_id,
                silent=True,
                hide_via=True,
            )
        await event.delete()
    except ChatSendInlineForbiddenError:
        await event.edit("**╪м╪з╪▒┘К ╪з┘Д╪к╪н┘И┘К┘Д **")
    except ChatSendStickersForbiddenError:
        await event.edit("**╪м╪з╪▒┘К ╪з┘Д╪к╪н┘И┘К┘Д **")
